import React from 'react';
import './App.css';

function Experience() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          EXPERIENCE
        </h1>
        <p>
          Our fantasitic experience
        </p>
      </header>
    </div>
  );
}

export default Experience;
